    Get a datetime object based on a random date between two given dates.
    Accepts date strings that can be recognized by strtotime().

    :param start_date: Defaults to 30 years ago
    :param end_date: Defaults to "now"
    :param tzinfo: timezone, instance of datetime.tzinfo subclass
    :example: datetime('1999-02-02 11:42:52')
    :return: datetime
    """
    start_date = self._parse_date_time(start_date, tzinfo=tzinfo)
    end_date = self._parse_date_time(end_date, tzinfo=tzinfo)

    # Create a new random generator with the current seed to ensure reproducibility
    current_seed = self.generator.random.getstate()
    rand_for_ts = random_module.Random()
    rand_for_ts.setstate(current_seed)

    if end_date - start_date <= 1:
